"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[3497],{25222:(a,t,n)=>{n.r(t),n.d(t,{default:()=>i,johnChapter17SW:()=>e});const e={chapter:17,title:"Jean 17",version:"Swahili Union Version",language:"sw",direction:"ltr",verses:[{number:1,text:"Yesu alinena hayo; akainua macho yake mbinguni, akasema, Baba, saa imekuja; mtukuze Mwana wako, ili Mwana naye akutukuze wewe;",strong:[{text:"avoir",strong:"G1372",start:6,end:11},{text:"ciel",strong:"H8064",start:48,end:52},{text:"Fils",strong:"G5207",start:100,end:104},{text:"Fils",strong:"G5207",start:119,end:123}]},{number:2,text:"kama ulivyompa mamlaka juu ya wanadamu wote, ili wote uliompa, awape uzima wa milele.",strong:[{text:"selon",strong:"G2531",start:0,end:5},{text:"chair",strong:"G4561",start:44,end:49}]},{number:3,text:"Na huu ndio uzima wa milele, wakujue wewe, Mungu pekee wa kweli, na Yesu Kristo uliyemtuma.",strong:[{text:"seul",strong:"G3439",start:59,end:63},{text:"Dieu",strong:"G2316",start:69,end:73},{text:"Christ",strong:"G5547",start:108,end:114}]},{number:4,text:"Mimi nimekutukuza wewe duniani, nimeilmaliza ile kazi uliyonipa nifanye.",strong:[{text:"terre",strong:"H776",start:24,end:29},{text:"faire",strong:"G1080",start:72,end:77}]},{number:5,text:"Na sasa wewe Baba, unitukuze pamoja nawe kwa ule utukufu niliokuwa nao pamoja nawe kabla ya ulimwengu kuwepo.",strong:[{text:"monde",strong:"G2889",start:109,end:114}]},{number:6,text:"Nimefunua jina lako kwa watu ulionipatia kutoka ulimwenguni; walikuwa wako, nawe ukanipa, nao wamelishika neno lako.",strong:[{text:"monde",strong:"G2889",start:66,end:71},{text:"parole",strong:"G3056",start:136,end:142}]},{number:7,text:"Sasa wamejua ya kuwa vitu vyote ulivyonipa vimetoka kwako;",strong:[{text:"tout",strong:"G3956",start:29,end:33}]},{number:8,text:"kwa sababu maneno uliyonipa mimi nimewapa; nao walipokea, wakajua kwa kweli ya kuwa nilitoka kwako, wakasadiki ya kuwa wewe ulinituma.",strong:[]},{number:9,text:"Mimi ninawaombea; siuombei ulimwengu, bali ninawaombea ulionipa; kwa sababu ni wako;",strong:[{text:"monde",strong:"G2889",start:51,end:56}]},{number:10,text:"na vyangu vyote ni vyako, na vyako ni vyangu; nami nimetukuzwa ndani yao.",strong:[{text:"tout",strong:"G3956",start:3,end:7}]},{number:11,text:"Wala si katika ulimwengu tena; lakini hawa wamo ulimwenguni, nami ninakuja kwako. Baba Mtakatifu, waweke katika jina lako, wale ulionipa, ili wawe mmoja, kama sisi tulivyo.",strong:[{text:"dans",strong:"H6887",start:16,end:20},{text:"monde",strong:"G2889",start:24,end:29},{text:"dans",strong:"H6887",start:43,end:47},{text:"monde",strong:"G2889",start:51,end:56},{text:"comme",strong:"G2531",start:152,end:157}]},{number:12,text:"Nilipokuwa pamoja nao, niliwaweka katika jina lako; wale ulionipa niliwahifadhi; wala hakuna hata mmoja wao aliyepotea, ila yule mwana wa upotevu, ili maandiko yatimie.",strong:[{text:"avec",strong:"G1848",start:16,end:20},{text:"dans",strong:"H6887",start:25,end:29},{text:"monde",strong:"G2889",start:33,end:38},{text:"aucun",strong:"G3762",start:106,end:111},{text:"fils",strong:"G5207",start:143,end:147}]},{number:13,text:"Lakini sasa ninakuja kwako; nami nasema mambo haya ulimwenguni, ili wakuwe na furaha yangu ikiwa timilifu ndani yao.",strong:[{text:"dans",strong:"H6887",start:50,end:54},{text:"monde",strong:"G2889",start:58,end:63}]},{number:14,text:"Mimi nimewapa neno lako; na ulimwengu umewachukia, kwa sababu si wa ulimwengu, kama mimi nisilivyo wa ulimwengu.",strong:[{text:"parole",strong:"G3056",start:20,end:26},{text:"monde",strong:"G2889",start:34,end:39},{text:"monde",strong:"G2889",start:80,end:85},{text:"comme",strong:"G2531",start:87,end:92},{text:"monde",strong:"G2889",start:115,end:120}]},{number:15,text:"Siombi uwaondoe ulimwenguni, bali uwaweke mbali na yule mwovu.",strong:[{text:"monde",strong:"G2889",start:33,end:38}]},{number:16,text:"Si wa ulimwengu, kama mimi nisilivyo wa ulimwengu.",strong:[{text:"monde",strong:"G2889",start:19,end:24},{text:"comme",strong:"G2531",start:26,end:31},{text:"monde",strong:"G2889",start:54,end:59}]},{number:17,text:"Waweke wakfu katika kweli; neno lako ni kweli.",strong:[{text:"parole",strong:"G3056",start:32,end:38}]},{number:18,text:"Kama ulivyonituma mimi ulimwenguni, mimi nao nimewatuma ulimwenguni.",strong:[{text:"Comme",strong:"G2531",start:0,end:5},{text:"dans",strong:"H6887",start:21,end:25},{text:"monde",strong:"G2889",start:29,end:34},{text:"dans",strong:"H6887",start:60,end:64},{text:"monde",strong:"G2889",start:68,end:73}]},{number:19,text:"Na kwa ajili yao mimi ninajiweka wakfu mwenyewe, ili nao wawekwe wakfu katika kweli.",strong:[]},{number:20,text:"Wala siwaombei hawa tu, bali nawaombea nao wale watakaoniamini kwa neno lao;",strong:[{text:"parole",strong:"G3056",start:96,end:102}]},{number:21,text:"ili wote wawe mmoja; kama wewe, Baba, ulivyo ndani yangu, nami ndani yako, ili nao wawe ndani yetu; ili ulimwengu uamini ya kuwa wewe ulinituma.",strong:[{text:"comme",strong:"G2531",start:25,end:30},{text:"comme",strong:"G2531",start:59,end:64},{text:"monde",strong:"G2889",start:130,end:135}]},{number:22,text:"Na ule utukufu ulionipa nimewapa, ili wawe mmoja, kama sisi tulivyo mmoja;",strong:[{text:"comme",strong:"G2531",start:69,end:74}]},{number:23,text:"mimi ndani yao, nawe ndani yangu, ili wakamilike katika umoja, ili ulimwengu ujue ya kuwa wewe ulinituma, na umewapenda, kama ulivyonipenda mimi.",strong:[{text:"monde",strong:"G2889",start:73,end:78},{text:"comme",strong:"G2531",start:131,end:136}]},{number:24,text:"Baba, wale ulionipa, nataka kwamba wawepo mimi nilipo, ili wauone utukufu wangu ulionipa; maana ulinipenda kabla ya kuumbwa ulimwengu.",strong:[{text:"avec",strong:"G1848",start:69,end:73},{text:"monde",strong:"G2889",start:184,end:189}]},{number:25,text:"Baba mwenye haki, ulimwengu haukujui; bali mimi nimekujua; na hawa wamejua ya kuwa wewe ulinituma;",strong:[{text:"monde",strong:"G2889",start:15,end:20}]},{number:26,text:"nami nimewajulisha jina lako, nami nitaendelea kulijulisha; ili upendo ulionipenda nao uwe ndani yao, nami ndani yao.",strong:[{text:"amour",strong:"G25",start:77,end:82}]}]},i=e}}]);
